include("time_evolve.jl")

L=30
d=8
t=5.
Δt=0.625
α=0.25
β=0.6
p_left=0.0
p_right=1.0

#h1=[0 0 α 0; 0 -p_right p_left α; 0 p_right -p_left-α 0; 0 0 0 -α]
h=[0 0 0 0; 0 -p_right p_left 0; 0 p_right -p_left 0; 0 0 0 0]
#hl=[-β 0 0 0; β -p_right p_left 0; 0 p_right -p_left-β 0; 0 0 β 0]
h1=[0 α; 0 -α]
hl=[-β 0; β 0]
#(h1,h,hl)=(complex(h1),complex(h),complex(hl))
H=[h1,h,hl];
N=reshape([1. 0.; 0. 0.],(1,1,2,2))
Ident=reshape([1. 0.; 0. 1.],(1,1,2,2))
D=Array{Any}(L)
density=zeros(20,L)
for i=1:L
  #D[i]=complex(reshape([0.0;1.0],(1,1,2)))
  D[i]=reshape([0.0;1.0],(1,1,2))
end
#N=complex(N)
#Ident=complex(Ident)
for i=1:20
  print(i,": ")
  @time tMPS(D,H,t,Δt,d)
  for j=1:L
    #density[i,j]=overlap(D,D,:real,(N,j))[1]/overlap(D,D,:real,(Ident,1))[1]
    density[i,j]=stoc_expect_val(D,(N,j))[1]/stoc_expect_val(D,(Ident,1))[1]
  end
end


